func TestFace(t *testing.T) {
	assert := assert.New(t)

	var idocr IDOCR
	err := idocr.Face(base64imgFace)

	assert.Nil(err)
	assert.Equal("韦小宝", idocr.Name)
	assert.Equal("11204416541220243X", idocr.Num)
}

func TestBack(t *testing.T) {
	assert := assert.New(t)

	var idocr IDOCR
	err := idocr.Back(base64imgBack)

	assert.Nil(err)
	assert.Equal("深圳市公安局福田分局", idocr.Issue)
	assert.Equal("20040325", idocr.StartDate)
}

