func TestGetIDCard(t *testing.T) {
	assert := assert.New(t)

	faceUrl := "http://stoneip.info/wp-content/uploads/2014/12/20131168257.jpg"
	backUrl := "http://img.ixiumei.com/uploadfile/2017/0327/20170327021742930.jpg"

	idocr, err := GetIDCard(faceUrl, backUrl)

	assert.Nil(err)
	assert.Equal("韦小宝", idocr.Name)
	assert.Equal("11204416541220243X", idocr.Num)
	assert.Equal("深圳市公安局福田分局", idocr.Issue)
}

func TestFormatResult(t *testing.T) {
	assert := assert.New(t)

	aliResponse := `{"outputs":[{"outputLabel":"ocr_id","outputMulti":{},"outputValue":{"dataType":50,"dataValue":"{\"config_str\":\"{\\\"side\\\":\\\"back\\\"}\",\"end_date\":\"20240325\",\"issue\":\"深圳市公安局福田分局\",\"request_id\":\"20170714174929_a2ad6f0b8b0ab52a62fac9bbe8b07d56\",\"start_date\":\"20040325\",\"success\":true}"}}]}`

	var (
		idocr IDOCR
		value aliDataValue
	)
	value, err := idocr.formatResult(aliResponse)

	assert.Nil(err)
	assert.Equal("深圳市公安局福田分局", value.Issue)
	assert.Equal("20040325", value.StartDate)
}

